Movie Info: Paisa Paisa is a 2013 Indian Malayalam thriller film written and directed by debutante director Prasanth Murali. The film was produced by Raj Zacharias under the banner Celebs and Red Carpet and features Indrajith, Aju Varghese, Mamta Mohandas, Sandhya and Daniel Balaji in the lead roles. Set against the backdrop of Chennai and Kochi, Paisa Paisa is a multi-narrative realistic thriller showing how money can affect the lives of people. The film released on June 28, 2013. The songs were composed by debutant, Eby Salvin. Despite busy schedules, Rahul Raj composed the background score on special request from the director; whom he had associated with earlier, for ad films.

